import React, { Component } from 'react'
import Classes from './signin.module.css'
import Input from '../../UI/input/input'
import Axios from '../../../Axios'
import Aux from '../../../Utility/auxiliary'
//Aux baraye ine ke niaz be parent nadashte bashe
import { withRouter } from "react-router";
class login extends Component {
    state = {
        loginroles: {
            role: {
                elementType: 'select',
                elementConfig: {
                    options: [
                        { value: '', displayValue: 'choose your rule' },
                        { value: 'director_of_the_federation', displayValue: 'Director of the Federation' },
                        { value: 'style_manager', displayValue: 'Style Manager' },
                        { value: 'the_manager_does', displayValue: 'The manager does' },
                        { value: 'jury', displayValue: 'Jury' },
                        { value: 'doctor', displayValue: 'Doctor' },
                        { value: 'responsible_for_the_standings', displayValue: 'Responsible for the standings' },
                        { value: 'registration_officer', displayValue: 'Registration Officer' },
                        { value: 'fighter', displayValue: 'Fighter' },
                        { value: 'coach', displayValue: 'Coach' },

                    ]
                },
                value: '',
                validation: {
                    required: true,
                    minLength: 3,
                },
                valid: false,
                shouldValid: false
            },

            username: {
                elementType: 'input',
                //baraye inke niaz be dasti dorost kardan element nabashe
                elementConfig: {
                    type: 'text',
                    placeholder: 'User Name'
                    //vizhe gi haye element
                },
                value: '',
                validation: {
                    minLength: 4,
                    required: true
                    //baraye inke niaz hast ke etebar sanji beshe in mored ya inke ekhtiarie 
                },
                valid: false,
                shouldValid: false
            },
            password: {
                elementType: 'input',
                elementConfig: {
                    type: 'password',
                    placeholder: 'Password'
                },
                value: '',
                validation: {
                    required: true,
                    minLength: 8,
                },
                valid: false,
                shouldValid: false
            }
        },
        loginisvalid: false,
        //baraye inke agar hame dorost va kamel boodan  true beshe va darkhast ro befreste
        tokenid: '',
        infocurrect: null,
        errormessage: null,
        modal: false,
    }

    //validationHandler: baraye sanjeshe etelat karbar
    validationHandler = (value, rules) => {
        let isvalid = true;
        let valueArray = value.split('');
        if (rules.required) {
            for (let i in valueArray) {
                isvalid = valueArray[i] !== " " && isvalid
                //baraye inke beyn horoof space nabashe
            }
            // isvalid = value.trim() !== '' && isvalid;
            //check mikone ke aval space nabashe
        }
        if (rules.minLength) {
            isvalid = value.length >= rules.minLength && isvalid;
            //kamatar az hade gofte shode nabashe
        }

        if (rules.maxLength) {
            isvalid = value.length <= rules.maxLength && isvalid;
            //bishtar az hade gofte shode nabashe

        }

        return isvalid;
    }

    changeHandler = (event, id) => {
        const updateControls = {
            ...this.state.loginroles,
            [id]: {
                ...this.state.loginroles[id],
                value: event.target.value,
                valid: this.validationHandler(event.target.value, this.state.loginroles[id].validation),
                shouldValid: true
            }
        };
        let check = true
        //check baray ine ke agar hame true boodan form loginisvalid ro true kone
        for (let valid in updateControls) {
            check = updateControls[valid].valid && check
        }

        this.setState({ loginroles: updateControls, loginisvalid: check })
    }

    submitHandler = () => {
        this.setState({ spinner: true })
        const data = {
            role: this.state.loginroles.role.value,
            username: this.state.loginroles.username.value,
            password: this.state.loginroles.password.value,
        }
        Axios.post('/auth/login', data)
            .then(response => {
                console.log(response.data);
                if (response.data.messages[0] === 'success') {
                    this.setState({ spinner: false, modal: true, tokenid: response.data.access_token })
                    localStorage.setItem('token', response.data.access_token);
                    this.props.history.push('/');
                }
            })
            //agar etelata dorost bashe be safhe aval bar migardoone  nist
            .catch(err => {
                this.setState({ infocurrect: err.message, spinner: false });
                console.log(err.message)
            })
        //agar hengame ferestadan request moshkeli pish biad va error bede mizane some thing something went error

    }
    render() {
        let elementArray = [];
        for (let key in this.state.loginroles) {
            elementArray.push({
                config: this.state.loginroles[key],
                id: key
            });
        }
        //in ghesmat baray ine ke data ei ke be soorat object hast ro be array tabdil kone
        let form = (<Aux>
            <form className={Classes.LoginForm}>
                {elementArray.map((data, index) => {
                    return <Input
                        index={index}
                        key={data.id}
                        icon={data.id}
                        //baraye icon kenar input
                        elementType={data.config.elementType}
                        // noe input
                        elementConfig={data.config.elementConfig}
                        // data haye input
                        value={data.config.value}
                        shouldValid={data.config.validation.required}
                        // baraye etebar sanji
                        touched={data.config.shouldValid}
                        // baraye inke hengame vorood input ro ghermez nakone va nazane etebar sanji nashode
                        valid={!data.config.valid}
                        //baraye etebar sanji
                        changed={(i) => this.changeHandler(i, data.id)}
                    //save kardan data 
                    />

                })}
                {/* inja nesbat be ghesmat hayi ke darim input misaze */}
            </form>
            <button className={Classes.Submit}
                disabled={!this.state.loginisvalid}
                onClick={this.submitHandler}>SIGN IN</button>
        </Aux>)

        if (this.state.spinner) {
            form = (
                <div className={Classes.spinner_body}>
                    <div className={Classes.spinner_container}>
                        <div className={Classes.spinner}></div>
                        <div className={Classes.spinner}></div>
                        <div className={Classes.spinner}></div>
                        <div className={Classes.spinner}></div>
                        <div className={Classes.spinner}></div>
                    </div></div>
            )
        }
        let info = null
        if (this.state.infocurrect) {
            info = <p className={Classes.Error}>
                Your information isn't currect
            </p>
        }
        if (this.state.errormessage) {
            info = <p className={Classes.Error}>
                something went error
            </p>
        }

        return (
            <div className={Classes.SignIn} >
                <span>
                    <svg className={Classes.Logo} width="178" height="167" viewBox="0 0 178 167" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                        <ellipse cx="89" cy="83.5" rx="89" ry="83.5" fill="url(#pattern0)" />
                        <defs>
                            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                <use xlinkHref="#image0" transform="translate(-0.0375982) scale(0.00138378)" />
                            </pattern>
                            <image id="image0" width="777" height="678" xlinkHref="data:image/png;base64," />
                        </defs>
                    </svg>
                </span>
                <h1 className={Classes.SignInBasirdocharkh}>Sign in to Basirdocharkh</h1>
                {form}
                {info}
                <a className={Classes.ForgotPass} href=''>Forgot Password?</a>

            </div>)
    }
}
export default withRouter(login)